    let { subject, body } = this.state;
    window.open(
      "https://mail.google.com/mail/u/0/?fs=1&to=pradeepsfdc07@gmail.com&su=mysubject&body=mybody&bcc=ypradeepraoame@gmail.com&tf=cm",
      "_self"
    );
  };

  render() {
    return (
      <div className="org-cdivv-esp">
        <div>
          <div>
